Rules.InvariantScript:
If(
    And(
        TextInputField.CollectJSONStrings,
        !IsBlank(Self.Value)
    ),
    Patch(
        colJSONStrings,
        Coalesce(
            LookUp(
                colJSONStrings,
                Control = TextInputField.PropertyLabel
            ),
            Defaults(colJSONStrings)
        ),
        {
            Control: TextInputField.PropertyLabel,
            Value: Self.Value,
            Type: 'Data Type (Activity Step Values)'.String,
            JSONString: With(
                {
                    _quotes: """",
                    _colon: ": "
                },
                Concatenate(
                    _quotes,
                    TextInputField.PropertyLabel,
                    _quotes,
                    _colon,
                    _quotes,
                    TextInputCanvas3.Value,
                    _quotes
                )
            )
        }
    ),
    RemoveIf(
        colJSONStrings,
        Control = TextInputField.PropertyLabel
    )
)
